{"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/eliasgerena/case-study-how-does-a-bike-share-navigate-speed?scriptVersionId=136976840\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Case Study: How Does a Bike-Share Navigate Speedy Success?\n\n<font size = \"3\"> <font color = \"gray\"> Author: Elias Gerena\n    \n<font size = \"3\"> <font color = \"gray\"> Date: 7/15/2023","metadata":{}},{"cell_type":"markdown","source":"# Introduction\nThis project serves as the final project of the Google Data Analytics Professional Certificate program, designed to equip participants with the necessary skills and knowledge for a successful career in data analytics. The program offers comprehensive training in essential analytical skills, including data cleaning, analysis, and visualization, as well as proficiency in prominent tools such as Excel, SQL, R Programming, and Tableau.\n\nThis project will analyze publicly available data sets, provided by the course, for a bike share program based in Chicago.","metadata":{}},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green > **About The Company**\n    \nIn 2016, Cyclistic successfully launched a bike-share program in Chicago, which has now expanded to include 5,824 geotracked bicycles and 692 stations across the city. The program allows riders to unlock bikes from one station and return them to any other station within the network at any time.\n\nPreviously, Cyclistic's marketing strategy focused on creating general awareness and targeting broad consumer segments. They offered flexible pricing plans, including single-ride passes, full-day passes, and annual memberships. Customers who purchased single-ride or full-day passes were considered casual riders, while those who opted for annual memberships were Cyclistic members.\n\nCyclistic's finance analysts have determined that annual members generate higher profits compared to casual riders. Recognizing the importance of maximizing the number of annual members for future growth, the company's director of marketing, Moreno, believes there is a significant opportunity to convert casual riders into members. Since casual riders are already aware of the Cyclistic program and have chosen it for their mobility needs, Moreno aims to design marketing strategies that specifically target this group.\n\nTo achieve this goal, the marketing analyst team needs a deeper understanding of the differences between annual members and casual riders, the motivations behind casual riders purchasing memberships, and the potential impact of digital media on their marketing tactics. Moreno and her team plan to analyze the historical bike trip data provided by Cyclistic to identify trends and gain valuable insights.","metadata":{}},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green > **Scenario**\n    \nI work as a junior data analyst in the marketing analyst team at Cyclistic, a bike-share company based in Chicago. Our director of marketing firmly believes that the future success of our company hinges on maximizing the number of annual memberships. As a result, my team's primary objective is to gain a deep understanding of how casual riders and annual members utilize Cyclistic bikes in distinct ways. By uncovering these insights, we aim to develop an effective marketing strategy that can successfully convert casual riders into annual members. However, before presenting our recommendations, we need the approval of Cyclistic executives, which necessitates backing up our proposals with compelling data insights and professional data visualizations.\n    \nIn order for my capstone to be considered complete I have to follow the 6 Phases of data analysis program:\n    \n<font size = \"3\" > <font color = blue >1) Ask \n    \n<font size = \"3\" > <font color = blue >2) Prepare \n    \n<font size = \"3\" > <font color = blue >3) Process \n    \n<font size = \"3\" > <font color = blue >4) Analyze\n    \n<font size = \"3\" > <font color = blue >5) Share\n    \n<font size = \"3\" > <font color = blue >6) Act\n    ","metadata":{}},{"cell_type":"markdown","source":"<font size = \"5\" > <font color = blue > **Ask**\n    \n<font size = \"5\" >How do annual members and casual riders use Cyclistic bikes differently?\n    \n    The assigned business task aims to analyze the bike share data to identify variations in usage patterns between annual members and casual riders. The findings from this analysis will be presented to the Cyclistic marketing team. The Director of Marketing has expressed a keen interest in increasing the number of annual memberships and plans to develop targeted advertising campaigns specifically tailored to convert casual riders into annual members.\n    \n   <font size = \"4\" > The other two questions that have to be addressed are:\n    \n   <font size = \"5\" > Why would casual riders buy Cyclistic annual memberships?\n\n   <font size = \"5\" > How can Cyclistic use digital media to influence casual riders to become members?","metadata":{}},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Characters and teams\n\n● Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n\n● Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n\n● Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. I joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how I can help Cyclistic as a junior data analyst, achieve their goals.\n\n● Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.","metadata":{}},{"cell_type":"markdown","source":"<font size = \"5\" > <font color = blue > **Prepare**\n    \n <font size = \"5\" > I will be using the public dataset located [here](https://divvy-tripdata.s3.amazonaws.com/index.html). The data for the project is provided by Motivate International, Inc. under this [license](https://ride.divvybikes.com/data-license-agreement). \n\nReliable - yes, not biased\n\nOriginal - yes, can locate the original public data\n\nComprehensive - yes, not missing important information\n\nCurrent - yes, updated monthly\n\nCited - yes\n     \n  <font size = \"3\" > <font color = gray >  NOTE: The data sets have a different name because Cyclistic is a fictional company created for the purposes of the capstone project as determined by the Google Data Analytics Professional Certificate program.\n\nThe data has been organized in monthly periods. Since this project was started in July of 2023, the data from July 2022 to June 2023 has been selected.","metadata":{}},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Key tasks:\n\nDownload data and store it appropriately : Data has been downloaded and copies have been stored on my computer.\n    \nIdentifying how it is organized: The data is in CSV (comma - separated values) format,and there are a total of 13 columns.\n    \nSorting and Filtering the data: For this analysis I will be using data for the last 12 months (July 2022 - June 2023).","metadata":{}},{"cell_type":"markdown","source":"The data included the following fields:\n\nride_id — a unique ID per ride\n\nrideable_type: the type of bicycle used\n\nstarted_at: the date and time that the bicycle was checked out\n\nended_at: the date and time that the bicycle was checked in\n\nstart_station_name: the name of the station at the start of the trip\n\nstart_station_id: a unique identifier for the start station\n\nend_station_name: the name of the station at the end of the trip\n\nend_station_id : a unique identifier for the end station\n\nStart_lat: the latitude of the start station\n\nstart_lng: the longitude of the start station\n\nend_lat: the latitude of the end station\n\nend_lng: the longitude of the end station\n\nDuring the analysis, the following fields were added:\n\nRide_length: the length of the ride calculated as ended_at — started_at.\n\nday_of_week: the day of the week for started_at\n\n<font size = \"3\" > <font color = green >To start off, install and add to the library the packages you need using R:","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\")\ninstall.packages(\"ggplot2\")\ninstall.packages(\"dplyr\")\ninstall.packages(\"lubridate\")\ninstall.packages(\"geosphere\")\nlibrary(tidyverse)  #helps wrangle data\nlibrary(lubridate)  #helps wrangle date attributes\nlibrary(ggplot2)  #helps visualize datlibs\nlibrary(geosphere)","metadata":{"execution":{"iopub.status.busy":"2023-07-16T18:28:13.54349Z","iopub.execute_input":"2023-07-16T18:28:13.544741Z","iopub.status.idle":"2023-07-16T18:28:13.559279Z"},"trusted":true},"execution_count":7,"outputs":[]},{"cell_type":"markdown","source":"When in R studio the code below first getwd displays my working directory and then setwd sets my working directory to simplify calls to data from my computer.","metadata":{}},{"cell_type":"code","source":"getwd() #displays your working directory\nsetwd(\"C:/Users/elias/Downloads/Divvy_Cyclist_Case_Study_Data\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Importing data into Rstudio:","metadata":{}},{"cell_type":"code","source":"  jul22 <- read.csv(\"202207-divvy-tripdata.csv\")\n  aug22 <- read.csv(\"202208-divvy-tripdata.csv\")\n  sep22 <- read.csv(\"202209-divvy-publictripdata.csv\")\n  oct22 <- read.csv(\"202210-divvy-tripdata.csv\")\n  nov22 <- read.csv(\"202211-divvy-tripdata.csv\")\n  dec22 <- read.csv(\"202212-divvy-tripdata.csv\")\n  jan23 <- read.csv(\"202301-divvy-tripdata.csv\")\n  feb23 <- read.csv(\"202302-divvy-tripdata.csv\")\n  mar23 <- read.csv(\"202303-divvy-tripdata.csv\")\n  apr23 <- read.csv(\"202304-divvy-tripdata.csv\")\n  may23 <- read.csv(\"202305-divvy-tripdata.csv\")\n  jun23 <- read.csv(\"202306-divvy-tripdata.csv\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Checking datasets for consistency:","metadata":{}},{"cell_type":"code","source":"   colnames(jul22)\n   colnames(aug22)\n   colnames(sep22)\n   colnames(oct22)\n   colnames(nov22)\n   colnames(dec22)\n   colnames(jan23)\n   colnames(feb23)\n   colnames(mar23)\n   colnames(apr23)\n   colnames(may23)\n   colnames(jun23)\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >To check data structures (dbl, chr, date)","metadata":{}},{"cell_type":"code","source":"    str(jul22)\n    str(aug22)\n    str(sep22)\n    str(oct22)\n    str(nov22)\n    str(dec22)\n    str(jan23)\n    str(feb23)\n    str(apr23)\n    str(may23)\n    str(jun23)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Merging the 12 months of data into a singular data frame:","metadata":{}},{"cell_type":"code","source":"     trip_data <- bind_rows(jul22, aug22, sep22, oct22, nov22, dec22, jan23, feb23, apr23, may23, jun23)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"5\" > <font color = blue > **Process**","metadata":{}},{"cell_type":"markdown","source":"This is where I clean and prepare the data for analysis\n\n<font size = \"3\" > <font color = green >Key tasks: \n\nCheck the data for the errors\n    \nChoose your tools\n    \nTransform the data so you can work with it effectively\n    \nDocument the cleaning process\n    \n<font size = \"3\" > <font color = green >Deliverable:  \n    \nDocumentation of any cleaning or manipulation of data\n    \nFollowing code chunks will be used for this “process phase:\n    \ncleaning and manipulation of data","metadata":{}},{"cell_type":"code","source":"     head(trip_data) #see the first 6 rows of the data frame\n\n     nrow(trip_data) #how many rows are in the data frame\n     colnames(trip_data) #list of column names\n     dim(trip_data) #dimensions of the data frame\n     summary(trip_data) #statistical summary of data, mainly for numerics\n     str(trip_data) #see list of columns and data types\n     tail(trip_data) #see the last 6 rows of the data frame","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Adding columns for date, month, year, day of the week into the data frame: ","metadata":{}},{"cell_type":"code","source":"      trip_data$date <- as.Date(trip_data$started_at)\n      trip_data$month <- format(as.Date(trip_data$date), \"%m\")\n      trip_data$day <- format(as.Date(trip_data$date), \"%d\")\n      trip_data$year <- format(as.Date(trip_data$date), \"%Y\")\n      trip_data$day_of_week <- format(as.Date(trip_data$date), \"%A\")\n      colnames(trip_data)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Add a ride_length calculation to trip_data:","metadata":{}},{"cell_type":"code","source":"        trip_data$ride_length <- difftime(trip_data$ended_at, trip_data$started_at)\n        str(trip_data)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Convert ride_length from Factor to Numeric in order to run calculations:","metadata":{}},{"cell_type":"code","source":"        trip_data$ride_length <- as.numeric(as.character(trip_data$ride_length))\n        is.numeric(trip_data$ride_length)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Add ride_distance calculation to trip_data: (km)","metadata":{}},{"cell_type":"code","source":"        trip_data$ride_distance <- distGeo(matrix(c(trip_data$start_lng, trip_data$start_lat), ncol=2), matrix (c(trip_data$end_lng, trip_data$end_lat), ncol=2))\n        trip_data$ride_distance <- trip_data$ride_distance/1000","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\" > <font color = green >Remove \"bad\" data:\n\nThe data frame includes a few hundred entries when bikes were taken out of docks and checked for quality by Divvy where ride_length was negative or \"ZERO”","metadata":{}},{"cell_type":"code","source":"        trip_data_clean <- trip_data[!(trip_data$ride_length <= 0),]\n        glimpse(trip_data_clean)\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"5\" > <font color = blue > **Analyze**","metadata":{}},{"cell_type":"markdown","source":"All of the information has now been compiled into one neat space and it's ready for analysis.\n\n<font size = \"3\" > <font color = green >Key tasks\n\n1: Aggregate your data so it’s useful and accessible.\n\n2: Organize and format your data.\n\n3: Perform calculations.\n\n4: Identify trends and relationships.\n\n<font size = \"3\" > <font color = green >Deliverable:\n\nA summary of the analysis.\n\nThe following code chunks will be used for this phase.\n    \n<font size = \"3\" > <font color = green >Summary of the analysis:","metadata":{}},{"cell_type":"code","source":"        str(trip_data_clean) # first check the structure of the data frame","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"        summary(trip_data_clean) # to check the summarized details of the clean data frame","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\"> Conduct descriptive analysis\n\nDescriptive analysis on 'ride_length'\n\nmean = straight average (total ride length / total rides)\n\nmedian = midpoint number of ride length\n\nmax = longest ride\n\nmin = shortest ride","metadata":{}},{"cell_type":"code","source":" trip_data_clean %>%\n\n    group_by(member_casual) %>%\n\n    summarise(average_ride_length = mean(ride_length), median_length = median(ride_length),\n\nmax_ride_length = max(ride_length), min_ride_length = min(ride_length))\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"5\" > <font color = blue >**Share**\n    \n    This is where all of the visualization begins\n    \n<font size = \"3\" > <font color = green > Key tasks:\n    \n1) Determine the best way to share your findings.\n    \n2) Create effective data visualizations.\n    \n3) Present your findings.\n    \n4) Ensure your work is accessible.\n    \n<font size = \"3\" > <font color = green >Deliverable: \n\nSupporting visualizations and key findings","metadata":{}},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\">Let's see total rides and average ride time by each day for members vs casual riders:","metadata":{}},{"cell_type":"code","source":"trip_data_clean %>%\n\n    group_by(member_casual) %>%\n\n    summarise(ride_count = length(ride_id))\n\n    trip_data_clean$day_of_week <- ordered(trip_data_clean$day_of_week,\n\n    levels = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\">Let's visualize average ride by day of the week:","metadata":{}},{"cell_type":"code","source":"trip_data_clean %>%\n\n  group_by(member_casual, day_of_week) %>%\n\n  summarise(number_of_rides = n()\n\n            ,average_ride_length = mean(ride_length),.groups=\"drop\") %>%\n\n  arrange(member_casual, day_of_week) #sort\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\">Let's visualize the above table by days of the week and number of rides taken by member and casual riders:","metadata":{}},{"cell_type":"markdown","source":"![download.png](attachment:65cecc8d-3d73-49b2-ab06-5f1879b21cdc.png)","metadata":{},"attachments":{"65cecc8d-3d73-49b2-ab06-5f1879b21cdc.png":{"image/png":""}}},{"cell_type":"markdown","source":"From the graph above, it is observed that casual riders have the highest number of rides on the weekend in comparison to the other days while members are quite consistent on both weekdays and weekends.","metadata":{}},{"cell_type":"code","source":"trip_data_clean %>%\n\n  group_by(member_casual, day_of_week) %>%\n\n  summarise(number_of_rides = n(), .groups=\"drop\") %>%\n\n  arrange(member_casual, day_of_week) %>%\n\n  ggplot(aes(x = day_of_week, y = number_of_rides, fill = member_casual)) +\n\n  labs(title =\"Total rides of Members and Casual riders Vs. Day of the week\") +\n\n  geom_col(width=0.5, position = position_dodge(width=0.5)) +\n\n  scale_y_continuous(labels = function(x) format(x, scientific = FALSE))\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\">Let's visualize average ride by day of the week:","metadata":{}},{"cell_type":"markdown","source":"![download.png](attachment:7a7c54a3-4983-4366-b997-8b1a4c439bdb.png)","metadata":{},"attachments":{"7a7c54a3-4983-4366-b997-8b1a4c439bdb.png":{"image/png":""}}},{"cell_type":"markdown","source":"From the graph above, we can see  that casual riders ride for a longer time during the week with the highest ride on the weekends while members drive at a consistent pace during the week with the highest rides on the weekend.","metadata":{}},{"cell_type":"code","source":"trip_data_clean %>%\n\n  group_by(member_casual, day_of_week) %>%\n\n  summarise(average_ride_length = mean(ride_length), .groups=\"drop\") %>%\n\n  ggplot(aes(x = day_of_week, y = average_ride_length, fill = member_casual)) +\n\n  geom_col(width=0.5, position = position_dodge(width=0.5)) +\n\n  labs(title =\"Average ride time of Members and Casual riders Vs. Day of the week\")\n","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\">Let's visualize the total rides taken by members and casuals by month:","metadata":{}},{"cell_type":"markdown","source":"![download.png](attachment:0c3b6218-30ec-4339-8ae4-c217f0259a44.png)","metadata":{},"attachments":{"0c3b6218-30ec-4339-8ae4-c217f0259a44.png":{"image/png":""}}},{"cell_type":"markdown","source":"From the above graph we can observe that members had a higher number of rides all throughout the year. ","metadata":{}},{"cell_type":"code","source":"trip_data_clean %>%\n\n  group_by(member_casual, month) %>%\n\n  summarise(number_of_rides = n(),.groups=\"drop\") %>%\n\n  arrange(member_casual, month)  %>%\n\n  ggplot(aes(x = month, y = number_of_rides, fill = member_casual)) +\n\n  labs(title =\"Total rides by Members and Casual riders by Month\") +\n\n  theme(axis.text.x = element_text(angle = 45)) +\n\n  geom_col(width=0.5, position = position_dodge(width=0.5)) +\n\n  scale_y_continuous(labels = function(x) format(x, scientific = FALSE))","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"3\"> <font color = \"green\">Let's compare Members and Casual riders depending on ride distance:","metadata":{}},{"cell_type":"markdown","source":"![download.png](attachment:92ec91ed-926d-4dd8-a01b-7d576068566c.png)","metadata":{},"attachments":{"92ec91ed-926d-4dd8-a01b-7d576068566c.png":{"image/png":""}}},{"cell_type":"markdown","source":"The distance traveled between Casual riders and members remained relatively stagnant means wise.","metadata":{}},{"cell_type":"code","source":"trip_data_clean %>%\n\n  group_by(member_casual) %>% drop_na() %>%\n\n  summarise(average_ride_distance = mean(ride_distance)) %>%\n\n  ggplot() +\n\n  geom_col(mapping= aes(x= member_casual,y= average_ride_distance,fill=member_casual), show.legend = FALSE)+\n\n  labs(title = \"Mean distance traveled by Members and Casual riders\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<font size = \"5\"> <font color = blue> **Act**\n    \n    \n<font color = gray> It is important to note that a significant limitation of the available data is the inability to link credit information with past purchases to protect user privacy. As a result, we are unable to determine which casual riders reside within the service area and which ones are visitors or tourists. However, if there is an alternative method to identify casual riders who live within the service area while still maintaining user privacy, it could greatly assist the marketing team in effectively targeting these individuals and converting them into member riders.\n    \nThat being said there are some insights that could be addressed from the above analysis and help guide the actions of the marketing team to achieve the goal of converting casual riders to member riders.","metadata":{}},{"cell_type":"markdown","source":"<font size = \"5\"> <font color = \"green\">**My top three recommendations based on my analysis**","metadata":{}},{"cell_type":"markdown","source":"\n1. Promoting or offering discounts during the low business months, particularly from November to February, presents a valuable opportunity for the company. Leveraging holidays as leeways for implementing these discounts can further enhance their effectiveness. By strategically promoting discounted rates or special offers during these quieter months, Cyclistic can incentivize ridership and mitigate the seasonal dip in demand. This approach not only helps maintain customer engagement during off-peak periods but also encourages potential customers who may be hesitant due to pricing concerns. The utilization of holiday-related promotions creates an additional layer of appeal, leveraging the festive spirit and aligning the discounts with customers' seasonal spending habits. Overall, this targeted discount strategy during low business months, coupled with holiday promotions, can contribute to increased ridership and revenue for Cyclistic.\n\n2. Casual riders typically exhibit longer ride durations in comparison to members within the Cyclistic bike-share program. This observation presents an opportunity to leverage the behavior of casual riders and encourage their conversion into members. One effective strategy to achieve this conversion is to offer specific benefits exclusively to members who ride for extended periods, incentivizing them to upgrade their status. By introducing perks such as discounted rates for longer rides, priority access to popular stations, or additional services tied to longer durations, Cyclistic can create a compelling value proposition for casual riders to become members. These tailored benefits provide a clear advantage for members, reinforcing the notion that an annual membership offers enhanced advantages and encourages casual riders to consider making the switch.\n\n3. To enhance bike availability in high-demand areas: Based on the analysis, it is evident that specific regions attract more bike rides, resulting in a scarcity of available bikes during peak hours. To mitigate the risk of potential customers opting for competitors or alternative transportation methods, Cyclistic should focus on increasing bike availability in these popular areas.","metadata":{}},{"cell_type":"markdown","source":"<font size = \"5\"> <font color = \"green\">Resources\n\n[Kaggle](http://https://www.kaggle.com) and [RPubs](http://https://rpubs.com) Community\n\nThis Case Study is public sourced from the [Coursera Google Data Analytics Capstone Project](http://https://www.coursera.org/enroll/google-data-analytics/paidmedia?utm_medium=sem&utm_source=gg&utm_campaign=B2C_NAMER_google-data-analytics_google_FTCOF_professional-certificates_country-US&campaignid=12504215975&adgroupid=122709142727&device=c&keyword=google%20data%20analytics%20certificate&matchtype=b&network=g&devicemodel=&adposition=&creativeid=664305267257&hide_mobile_promo&gclid=Cj0KCQjwqs6lBhCxARIsAG8YcDhQaT27QfKWj1BBfj2r9fFnOUYdvdsgP6vK0GRseaNV1o7bZkFmZQoaApcYEALw_wcB)","metadata":{}}]}